import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import Kform from "./Kform";

class App extends Component {
  render() {
    return (
      <div>
        <div className="container">
          <Kform container_class={'col-sm-6'}/>
        </div>
      </div>
    );
  }
}
export default App;
